import * as React from 'react';
import './index.less';
const Home: React.FC<{}> = () => {
    return (
        <div className={'hello'}>
            Hello world!
            <style jsx>
                {`
                    .hello {
                        font-family: Sofia-Pro-Black, serif;
                    }
                `}
            </style>
        </div>
    );
};

export default Home;
